import React from "react";
import ReactDOM from "react-dom";
import "./index.css";
import App from "./App";
import CardList from "./components/CardList";
import Quotes from "./components/Quotes";
import quimage from "./assets/images/logo1.png";
const quotes="Semoga bermanfaat";
const buah = [
  {nama :'Semangka',rasa:'Manis',warna:'Hijau',image:'https://asset.kompas.com/crops/q78JqO5-zMavlgtro4FjP27Ie-E=/0x34:600x434/750x500/data/photo/2021/04/19/607d4a758757a.jpg'},
  {nama :'Pisang',rasa:'Manis',warna:'Kuning',image: 'https://pict.sindonews.net/dyn/620/pena/news/2021/01/01/121/287054/ayo-banyak-berdoa-ini-motormotor-keren-yang-semoga-rilis-di-indonesia-2021-yog.jpg'},
  {nama :'Jeruk',rasa:'Asam',warna:'orange',image: 'https://ktbfuso.co.id/assets/uploads/categories/Bak-Kayu-LDT.png'},
  ]

ReactDOM.render(
  <React.StrictMode>
    <App />
    <div style={{display:'flex', flex:1,flexDirection:'row'}}>
    {buah.map((item,index)=>(
  <CardList id={index} nama={item.nama} rasa={item.rasa} warna={item.warna} image={item.image} />
  ))
  }
  </div>
    <Quotes author="Kelompok 38" quotes={quotes} quimage={quimage} />
  </React.StrictMode>,
  document.getElementById("root")
);
